function getLocation(){navigator.geolocation?navigator.geolocation.getCurrentPosition(showPosition,showError):x.innerHTML="Geolocation is not supported by this browser."}function showPosition(e){document.getElementById("long").value=e.coords.longitude,document.getElementById("lat").value=e.coords.latitude,document.getElementById("latlong").value=e.coords.latitude+","+e.coords.longitude}function showError(e){switch(e.code){case e.PERMISSION_DENIED:x.innerHTML="User denied the request for Geolocation.";break;case e.POSITION_UNAVAILABLE:x.innerHTML="Location information is unavailable.";break;case e.TIMEOUT:x.innerHTML="The request to get user location timed out.";break;case e.UNKNOWN_ERROR:x.innerHTML="An unknown error occurred."}}function copy_text(){var e=document.getElementById("latlong");e.select(),e.setSelectionRange(0,99999),navigator.clipboard.writeText(e.value)}function outFunc(){var e=document.getElementById("myTooltip");e.innerHTML="<i class='fa-regular fa-clipboard text-success'></i>"}function showlocation(){navigator.geolocation.getCurrentPosition(callback)}function callback(e){var o=e.coords.latitude,t=e.coords.longitude;document.getElementById("lat").innerHTML=o,document.getElementById("long").innerHTML=t;var n=new google.maps.LatLng(o,t),a=new google.maps.Marker({position:n});a.setMap(map),map.setZoom(8),map.setCenter(a.getPosition())}function initMap(){var e={center:new google.maps.LatLng(0,0),zoom:1,mapTypeId:google.maps.MapTypeId.ROADMAP};map=new google.maps.Map(document.getElementById("map-canvas"),e)}var x=document.getElementById("tampilkan"),map=null;google.maps.event.addDomListener(window,"load",initMap);